import { Card, Typography } from "@material-ui/core";
import { withStyles } from "@material-ui/core/styles";

const CustomCard = withStyles({
    root: {
      backgroundColor: "#242424",
      width: "100%",
      borderRadius: "15 px",
    },
  })(Card);

const Text = withStyles({
root: {
    color: "#7C3AED"
}
})(Typography);

export {
    CustomCard,
    Text
}
